import React from 'react';
import uuid from 'uuid';
import { useQuery, useMutation, useSubscription } from "@apollo/react-hooks";
import queries from 'queries/Empresas.jsx';
import { gql } from 'apollo-boost'

const getEmpresas = gql`${queries.getEmpresas}`;

const empresaitem = (props) => {


  // const datos= this.props.variables;

  const { data, error, loading } = useQuery(getEmpresas);

  if (loading) {
    return <div>Loading...</div>;
  };
  if (error) {
    return <div>Error! {error.message}</div>;
  };

  return (
    <tbody>
      {data.empresas.map(element => (
        <tr key={uuid()}>
          <th key={element._id} className="text-right">
            {element.nombre}
          </th>

          <th key={element._id} className="text-right">
            {element.correo}
          </th>

          <th key={element._id} className="text-right">
            {element.canton}
          </th>

          <th key={element._id} className="text-right">
            {element.provincia}
          </th>
        </tr>
      ))}
    </tbody>
  )
};

export default empresaitem;
